import React, {Component} from "react";

class ContactUs extends Component{
    render(){
        return (
            <div>
                <div id="contactContainer">
                    <div id="contactLeftContainer">
                        <h2>Contact Us</h2>
                        <p>Feel free to contact us any time. We will get back to you as soon as we can!</p>
                        <input type='text' placeholder="Name" id="nameInput"></input>
                        <input type='text' placeholder="Email" id="emailInput"></input>
                        <input type='text' placeholder="Message" id=""></input>
                    </div>
                    <div id="contactRightContainer"></div>
                </div>
            </div>
        );
    }
}

export default ContactUs
